INSERT INTO `v1_3ff6a3c553ba48793cb90d170f476f03042145fdbd1a457472866ad449cb9ecd` VALUES (1, 1, "スタンダードコレクション", "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！", 3, "1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！");
INSERT INTO `v1_3ff6a3c553ba48793cb90d170f476f03042145fdbd1a457472866ad449cb9ecd` VALUES (2, 1, "プレミアムコレクション", "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！", 10, "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！");
INSERT INTO `v1_3ff6a3c553ba48793cb90d170f476f03042145fdbd1a457472866ad449cb9ecd` VALUES (3, 1, "フェスコレクション", "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！", 3, "1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！");
